import React from "react";
import "./Navbar.css";

function Navbar() {
  return (
    <div className="navbar">
      <img
        src="https://5studios.net/themes/laapp/img/logo-light.png"
        alt=""
        className="navbar__logo"
      />

      <ul className="nav">
        <li>
          <a href="#" className="nav__item"></a>
          <a href="#" className="nav__item"></a>
          <a href="#" className="nav__item"></a>
          <a href="#" className="nav__item"></a>
          <a href="#" className="nav__item"></a>
        </li>
      </ul>
    </div>
  );
}

export default Navbar;
